import React, { Component } from 'react'
import Newsitem  from './Newsitem'

export class News extends Component {
    
    
    constructor(){
        super();
        console.log("Hii I am a constructor");
        this.state={
            articles:[],
        }
            
        
    }

   async componentDidMount(){
     console.log("I am api")
      let url = "https://newsapi.org/v2/top-headlines?country=in&category=business&apiKey=6291d4cab4f7474d9d2e84e787e7ad75";

      let data = await fetch(url);

      let parseData = await data.json();
     console.log(parseData)
      this.setState({articles:parseData.articles})

    }
  render() {

    return (
        <>
        
      <div className="container my-3">
          <div className="row">
          {this.state.articles.map((element)=>{
            return(
            
            <div className="col md-4" key={element.url}>
            <Newsitem title={element.title.slice(0,40)} description={element.description} imageurl={element.urlToImage} url={element.url}/>
            
            
        
              </div>
            )
            
        })}
              
              
              
          </div>
        
        </div>
        
        
          </>
    )
  }
}

export default News
